import React, { Component } from "react";
import {
  Col,
  Container,
  Row,
  Card,
  CardImg,
  CardBody,
  CardTitle,
  CardSubtitle,
  CardText,
  Button,
  NavItem,
  NavLink,
} from "reactstrap";
import { IoHeartOutline } from "react-icons/io5";

export default class Library extends Component {
  render() {
    return (
      <div>
        <Container>
          <Row>
            <Col xs="3">
              {this.props.library.map((book) => {
                <Card key={book.id}>
                  <CardImg alt="cover" top width="100%" />
                  <CardBody>
                    <CardTitle tag="h5">{book.title}</CardTitle>
                    <CardSubtitle className="mb-2 text-muted" tag="h6">
                      {book.author}
                    </CardSubtitle>
                    <CardText>{book.tags}</CardText>
                    <Button outline>Read</Button>{" "}
                    <Button color="danger" outline>
                      Remove
                    </Button>{" "}
                    <IoHeartOutline size={35} />
                  </CardBody>
                </Card>;
              })}
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}
